import React from "react";

function Plots({ selectedParameters }) {
  return (
    <div className="plots-container">
      {selectedParameters.length === 0 ? (
        <p className="no-plot-message">Select a parameter to display plots.</p>
      ) : (
        selectedParameters.map((param, index) => (
          <div key={index} className="plot-panel">
            <h4>{param} Plot</h4>
            <div className="plot-content"> {/* Placeholder for actual chart component */}
              <p>Graph for {param} will be shown here.</p>
            </div>
          </div>
        ))
      )}
    </div>
  );
}

export default Plots;
